import { TableRow, TableData, TableWrapper } from './MoreInfoTable.style';

export interface Props {
  rows: any[][];
}

export const MoreInfoTable = ({ rows }: Props) => {
  return (
    <TableWrapper>
      {rows.map((row, index) => (
        <TableRow key={index}>
          {row.map((elem, index) => (
            <TableData key={index} headerRow={index === 0}>
              {elem}
            </TableData>
          ))}
        </TableRow>
      ))}
    </TableWrapper>
  );
};
